import react,{useState} from "react";
import axios from "axios";


const Products=()=>{
const [title,setTitle]=useState();
const loadTitle=()=>{
axios.get("https://ecommerce-response.herokuapp.com/")
.then(response=>{
setTitle(response.data)
  })


}


   return(
     <div className="child2">
       <p>see some titles</p>
       <div className="btn-container" onClick={loadTitle}><button className="form-btn">click here</button></div>
              <hr></hr>
         <ul>
            {title&&title.map(el=> <li key={el.id}>{el.title}</li>)}
         </ul>
     </div>
   );
}
export default Products ;
